(36, 'Sergio', 'Sanmiguel Romero', 'sergio.sanmiguel@gmail.com', NULL, NULL, NULL, NULL, 'Colombia', NULL, NULL, 2, 1, 'sanmiguelsergio', '$2y$10$WS7pGZyP6WfEChv/PJsJ7eKwPMUvb6Up0.L6HpiIUst/UoxOi.y3G', NULL, NULL, '4C39,R,(538ZFNJ,J6WS', 'Mi nombre es Sergio Sanmiguel Romero. Soy Arquitecto egresado de la Universidad Javeriana de Bogot&aacute; en el a&ntilde;o 2006, y Master en Ingenieria Estructural en la Arquitectura de la Universidad Politecnica de Catalu&ntilde;a en el a&ntilde;o 2013. Soy socio fundador de la firma Sanmiguel Arquitectos SAS desde el a&ntilde;o 2009 con sede en Bucaramanga, Colombia. \r\nMi actividad profesional es fundamentalmente el dise&ntilde;o arquitect&oacute;nico y la direcci&oacute;n de obras civiles. En mi trayectoria como arquitecto he participado en proyectos de vivienda unifamiliar y multifamiliar, edificios institucionales y comerciales, centro comerciales, entre otros. Los tres proyectos mas importantes que he desarrollado son Torre del Vento (Bucaramanga), el Centro Comercial El Puente (San Gil) y el Centro Comercial y de Servicios Automotriz (Bucaramanga).', 'ssr2.jpg', NULL, 1, 23, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-04-01', '2019-04-01', NULL),
